import './App.css';
import React, {useState} from './react'
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './pages/HomePag'
import Anunciar from './pages/AnunciarPag'
import Perfil from './pages/PerfilPag'
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer'
import ProdutoPag from './pages/ProdutoPag';


function App() {

  const [projetos, setProjetos] = useState(
    [{nome: 'Pro 1', sigla: 'P1'},
     {nome: 'Pro 1', sigla: 'P1'}]
  );

  return (
    <Router>
      <Header/>
      <Routes>
        <Route path="/" element={<Home/>} projetos={projetos} setProjetos={setProjetos}/>
        <Route path="/Perfil" element={<Perfil/>}/> 
        <Route path="/Anunciar" element={<Anunciar/>} projetos={projetos} setProjetos={setProjetos}/>
        <Route path="/ProdutoPag" element={<ProdutoPag/>} projetos={projetos} setProjetos={setProjetos}/> 
      </Routes>  
      <Footer/>
    </Router>
  );
}

export default App;















